import './App.css';
import Video from './component/video/video'
import LessonIntro from './component/lesson-intro/lessonintro'
import active from './img/slices/试听@2x.png'

function App() {
  const lessonData = {
    active: active,
    title: '像法国人一样说法语',
    score: '4.0',
    playNum: '12.33万'
  }
  return (
    <div className="App">
      <Video />
      <div className='box'>
        <div className='main-container'>
          <LessonIntro data={lessonData} />
        </div>
      </div>
    </div>
  );
}

export default App;
